import React from "react";

import './cat.sty'

const Cat = ({ title, icon, list}) => {
  return (
    <div>
      <i></i>
      <span>{ title }</span>
          <ul>
              <li>{list}</li>
      </ul>
    </div>
  );
};

export default Cat;
